import {Component} from 'react';
import Qusetion from './faqQuestion';

class Questions extends Component {


    render() {
        return (
            <div className="container">
                <Qusetion title="كيف يمكنني  تحميل التطبيق ؟" answear="معنديش فكره بصراحه لسه "/>
            </div>
        );
    }
}


export default Questions;
